import "./App.css";
import 'bootstrap/dist/js/bootstrap.bundle.min';
import logo from "./assets/logo.png";
import protection from "./assets/protection.png";
import lungs from "./assets/lungs.png";
import food from "./assets/food.png";
import mind from "./assets/mind.png";
import doge from "./assets/vetdoge.jpg";
import tic from "./assets/tic.png";

function App() {
  return (
    <div className="container-fluid text-center">
      <header className="py-4 bg-light">
        <img src={logo} alt="Bio Logo" className="img-fluid mb-3" style={{ maxWidth: '300px' }} />
      </header>

      <section className="py-5 bg-primary text-white">
        <h1 className="display-3 font-weight-bold">Грижим се за тяхното здраве</h1>
      </section>

      <section className="py-5">
        <div className="container">
          <div className="row g-4">
            {/* Feature Cards */}
            {[
              { img: protection, title: "Защита от зарази", description: "Lorem ipsum dolor sit amet, consectetur adipiscing elit. Sem velit viverra amet faucibus." },
              { img: lungs, title: "100% възтановяване", description: "Lorem ipsum dolor sit amet, consectetur adipiscing elit. Sem velit viverra amet faucibus.", highlighted: true },
              { img: food, title: "Натурални съставки", description: "Lorem ipsum dolor sit amet, consectetur adipiscing elit. Sem velit viverra amet faucibus." },
              { img: mind, title: "Без травми", description: "Lorem ipsum dolor sit amet, consectetur adipiscing elit. Sem velit viverra amet faucibus." },
            ].map((feature, index) => (
              <div key={index} className={`col-12 col-md-6 col-lg-3`}>
                <div className={`card ${feature.highlighted ? 'bg-primary text-white' : 'bg-light'} border-0 rounded shadow-sm`}>
                  <img src={feature.img} className="card-img-top p-4" alt={feature.title} style={{ width: '92px', height: '92px', margin: '0 auto' }} />
                  <div className="card-body">
                    <h5 className="card-title">{feature.title}</h5>
                    <p className="card-text">{feature.description}</p>
                  </div>
                </div>
              </div>
            ))}
          </div>
        </div>
      </section>

      <section className="py-5">
        <div className="container">
          <div className="row g-4 align-items-center">
            <div className="col-12 col-md-6">
              <img src={doge} alt="Decorative" className="img-fluid rounded shadow-sm" />
            </div>
            <div className="col-12 col-md-6">
              <h2 className="font-weight-bold mb-4">Защо да изберете нас?</h2>
              <ul className="list-unstyled">
                {[
                  "Lorem ipsum dolor sit amet, consectetur adipiscing elit.",
                  "Lorem ipsum dolor sit amet, consectetur adipiscing elit.",
                  "Lorem ipsum dolor sit amet, consectetur adipiscing elit.",
                  "Lorem ipsum dolor sit amet, consectetur adipiscing elit.",
                  "Lorem ipsum dolor sit amet, consectetur adipiscing elit.",
                ].map((benefit, index) => (
                  <li key={index} className="d-flex align-items-center mb-2">
                    <img src={tic} alt="Check" className="me-2" style={{ width: '20px', height: '20px' }} />
                    {benefit}
                  </li>
                ))}
              </ul>
              <a href="#" className="btn btn-primary mt-3">Learn More →</a>
            </div>
          </div>
        </div>
      </section>
    </div>
  );
}

export default App;
